import React, { Component } from "react";
import { Grid, Cell, ProgressBar } from "react-mdl";
class Skills extends Component {
  render() {
    return (
      <Grid>
        <Cell coll={12}>
          <div style={{ display: "flex" }}>
            {this.props.skill}
            <ProgressBar />{" "}
          </div>
        </Cell>
      </Grid>
    );
  }
}

export default Skills;
